	setText = function (id, value) {
		min = g_index_data.get(id).min
		max = g_index_data.get(id).max
		if (min == undefined && max == undefined) {
			$('#' + id).text(value)
			switch (id) {
				case "qrsF":
				case "pF":
				case "tF":
					$('#' + id).text(`${value === 0 ? "向上" : "向下"}`)
					break
				case "pY":
					let py_arr = ["单向圆钝", "切迹", "双峰", "正负双向", "负正双向"]
					$('#' + id).text(`${py_arr[value]}`)
					break
				case "prY":
				case "stY":
					let prY_arr = ["水平型", "上斜型", "下斜型"]
					$('#' + id).text(`${prY_arr[value]}`)
					break
				case "jYn":
					$('#' + id).text(`${value === 0 ? "无" : "是"}`)
					break
				case "tY":
					let obj = {
						0: "单向圆钝",
						1: "高耸",
						2: "平坦",
						3: "倒置",
						4: "切迹",
						5: "双峰",
						6: "正负双向",
						7: "负正双向"
					}
					$('#' + id).text(`${obj[value]}`)
					break
				default:
					return ''
			}
		} else if (min == undefined && max != undefined) {
			if (value > max) {
				$('#' + id).text(value + "  ↑")
				$('#' + id).css("color", "red")
			} else {
				$('#' + id).text(value)
			}
		} else if (min != undefined && max == undefined) {
			if (value < min) {
				$('#' + id).text(value + "  ↓")
				$('#' + id).css("color", "red")
			} else {
				$('#' + id).text(value)
			}
		} else {
			if (value < min) {
				$('#' + id).text(value + "  ↓")
				$('#' + id).css("color", "red")
			} else if (value > max) {
				$('#' + id).text(value + "  ↑")
				$('#' + id).css("color", "red")
			} else {
				$('#' + id).text(value)
			}
		}


	}
